package com.hummingbird.maaccount.vo;

import com.hummingbird.commonbiz.vo.AppMobileDecidable;

public class UnbindCardVO extends AppBaseVO implements AppMobileDecidable{
	private UnbindVO unbind;

	

	public UnbindVO getUnbind() {
		return unbind;
	}

	public void setUnbind(UnbindVO unbind) {
		this.unbind = unbind;
	}

	@Override
	public String getAppId() {
		// TODO Auto-generated method stub
		return app.getAppId();
	}

	@Override
	public String getMobileNum() {
		// TODO Auto-generated method stub
		return unbind.getMobileNum();
	}
	
	@Override
	public String toString() {
		return "BankCardVO [unbind=" + unbind + ", app=" + app + "]";
	}
	
}
